INSERT INTO `hhs_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `is_shipping`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `share_bonus_type`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `team_num`, `team_price`, `little_img`, `sales_num`, `is_mall`, `is_team`, `is_nearby`, `guige`, `discount_type`, `discount_amount`, `limit_buy_bumber`, `limit_buy_one`, `subscribe` ) VALUES  ('37', '1', 'HHS000002', '【测试商品-网站演示专用】   板牙妹妹坚果零食炒货夏威夷果澳洲特产零食奶油味送开口器', '+', '133', '0', '', '101', '0.110', '48.00', '40.00', '0.00', '0', '0', '1', '', '生态种植，天然品质，2个59元限时包邮，仅限江浙沪地区顾客购买', '<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 很多朋友都已经抢先体验了3G网络的可视通话、高速上网等功能。LG KD876手机<span style=\"font-size:x-large;\"><span style=\"color:#FF0000;\"><strong>支持TD-SCDMA/GSM双模单待</strong></span></span>，便于测试初期GSM网络和TD网络之间的切换和共享。\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LG KD876手机整体采用银色塑料材质，<strong><span style=\"font-size:x-large;\"><span style=\"color:#FF0000;\">特殊的旋转屏设计是本机的亮点</span></span></strong>，而机身背部的300万像素摄像头也是首发的六款TD-SCDMA手机中配置最高的。LG KD876手机屏幕下方设置有外键盘，该键盘由左/右软键、通话/挂机键、返回键、五维摇杆组成，摇杆灵敏度很高，定位准确。KD876的内键盘由标准12个电话键和三个功能键、一个内置摄像头组成。三个功能键分别为视频通话、MP3、和菜单键，所有按键的手感都比较一般，键程适中，当由于按键排列过于紧密，快速发短信时很容易误按，用户在使用时一定要多加注意。LG KD876手机机身周边的接口设计非常简洁，手机的厚度主要来自屏幕旋转轴的长度，如果舍弃旋屏设计的话，估计<span style=\"font-size:x-large;\"><strong><span style=\"color:#FF0000;\">厚度可以做到10mm以下</span></strong></span>。\r\n</p>', 'images/201507/thumb_img/37_thumb_G_1436309913097.jpg', 'images/201507/goods_img/37_G_1436309913469.jpg', 'images/201507/source_img/37_G_1436309913144.jpg', '1', '', '0', '1', '0', '0', '1436309913', '100', '0', '0', '0', '0', '0', '0', '17', '1441646885', '11', '', '-1', '-1', '0', '', '3', '2.00', 'images/201507/thumb_img/37_thumb_G_1436309913097.jpg', '0', '0', '0', '0', '', '0', '0.00', '0', '0', '0');
